import React from "react";

function Headeris({
  klase = "d-flex align-items-center justify-content-between",
  stilius = {},
  logo = "smile.jpg",
  logo_plotis = 100,
}) {
  return (
    <header className={klase} style={stilius}>
      <img
        src={require("../images/" + logo)}
        width={logo_plotis}
        alt="Logo"
        onError={(e) => {
          e.target.onerror = null; 
          e.target.src = require("../images/smile.jpg");
        }}
      />
    </header>
  );
}

export default Headeris;
